import "./styles.css";
import Navbar from '../src/components/Navbar';
import Searchbar from './components/Searcbar';

export default function App() {
  return (
    <div>
      <Navbar />
    <div className="App">
       <Searchbar />
    </div> 
    </div>
  );
}
